def fib(n):
    if n == 0:
        return 0
    elif n == 1:
        return 1
    else:
        a, b = 0, 1
        for _ in range(2, n + 1):
            a, b = b, a + b
        return b
```

### Explanation:
This function calculates the nth Fibonacci number using an iterative approach. The Fibonacci sequence is defined as follows: fib(0) = 0, fib(1) = 1, and for n > 1, fib(n) = fib(n-1) + fib(n-2). 

The function starts by checking if `n` is 0 or 1 and returns the corresponding value directly. For other values of `n`, it initializes two variables `a` and `b` to represent the first two Fibonacci numbers (0 and 1, respectively). It then iterates from 2 to `n`, updating `a` and `b` at each step to hold the last two Fibonacci numbers. Finally, it returns `b`, which holds the nth Fibonacci number after the loop completes.
